import React from "react";
import { Link } from "react-router-dom";
import "./Anasayfa.css";

const Anasayfa = () => {
  return (
    <div classname="HomePage">
      <div classname="AnaSayfaBaslik">
        <h1>
          <Link style={{ textDecoration: "none", color: "white" }} to="/">
            Teknolojik Yemekler
          </Link>
        </h1>
      </div>
      <h3>SİPARİŞ VER!</h3>
      <div classname="BASLIK">
        <h4>KOD ACIKTIRIR,</h4>
        <h4>PİZZA DOYURUR!</h4>
      </div>
      <div className="Buttonke">
        <button id="order-pizza">
          <Link style={{ textDecoration: "none", color: "black"}} to={"/pizza"}>TIKLA GELSİN</Link>
        </button>
      </div>
    </div>
  );
};

export default Anasayfa;
